import React from "react";
import "./App.css";
import useExchange from "./data/useExchange";
import { crypto, securitiesHiRisk } from "./data/data";

const App = () => {
  const rates = useExchange();
  const btcAmount = ((1 / rates.BTC) * crypto.amount).toFixed(2);
  const securitiesHiRiskAmount = (
    (1 / rates.EUR) *
    securitiesHiRisk.amount
  ).toFixed(2);
  console.log(typeof securitiesHiRiskAmount);

  return <div className="App">{btcAmount + securitiesHiRiskAmount} USD</div>;
};

export default React.memo(App);

